import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-booklist',
  templateUrl: './booklist.component.html',
  styleUrls: ['./booklist.component.css']
})
export class BooklistComponent {

  form: any = {
  list: [],
  search: {
    title: '',
    author: ''
  },
  delete: {},
  pageNo: 0,
  message: '',
  preload: []
}

  constructor(private http: HttpClient, private router: Router) { }

  ngOnInit(): void {
    this.preload();
    this.search();
  }

  previous() {
    if (this.form.pageNo > 0) {
      this.form.pageNo--;
      this.search();
    }
  }

  next() {
    this.form.pageNo++;
    this.search();
  }

  search() {
    this.http.post('http://localhost:8081/Book/search/' + this.form.pageNo, this.form.search)
      .subscribe((res: any) => {
        if (res.result?.message) {
          this.form.message = res.result.message;
        } else {
          this.form.message = '';
        }
        this.form.list = res.data || [];
      });
  }

  edit(id: number) {
    this.router.navigateByUrl('/book/' + id);
  }

  onCheckboxChange(id: number) {
    this.form.delete.id = id;
  }

  delete() {
    this.http.get('http://localhost:8081/Book/delete/' + this.form.delete.id).subscribe((res: any) => {
      this.form.message = res.result?.message || 'Deleted successfully';
      this.search();
    });
  }

  preload() {
    this.http.post('http://localhost:8081/Book/preload', this.form.search).subscribe((res: any) => {
      this.form.preload = res.result?.rolelist || [];
      this.form.list = res.result?.data || [];
    });
  }
}
<app-navbaar></app-navbaar>
<hr>
<h2>Book List</h2>
<p style="color: green;">{{ form.message }}</p>

<!-- Search Section -->
<div>
  <input type="text" placeholder="Enter Title" [(ngModel)]="form.search.title" />
  &nbsp;
  <input type="text" placeholder="Enter Author" [(ngModel)]="form.search.author" />
  &nbsp;
  <button (click)="search()">Search</button>
  &nbsp;
  <button (click)="delete()">Delete</button>
</div>

<br>

<!-- Book Table -->
<table border="1">
  <tr>
    <th>Select</th>
    <th>Cover</th>
    <th>ID</th>
    <th>Title</th>
    <th>Author</th>
    <th>Price</th>
    <th>Publisher</th>
    <th>Edit</th>
  </tr>

  <tr *ngFor="let b of form.list; let i = index">
    <td><input type="checkbox" (change)="onCheckboxChange(b.id)" /></td>
    <td>
      <img
        src="http://localhost:8081/Book/cover/{{ b.id }}"
        height="55px"
        width="60px"
        alt="No Cover"
      />
    </td>
    <td>{{ (form.pageNo * 5) + i + 1 }}</td>
    <td>{{ b.title }}</td>
    <td>{{ b.author }}</td>
    <td>{{ b.price }}</td>
    <td>{{ b.publisher }}</td>
    <td><a (click)="edit(b.id)" style="color: blue;">Edit</a></td>
  </tr>

  <tr>
    <td colspan="8">
      <button [disabled]="form.pageNo == 0" (click)="previous()">Previous</button>
      &nbsp;
      <button [disabled]="form.list.length < 5" (click)="next()">Next</button>
    </td>
  </tr>
</table>
